import React from 'react'
import HomeImg from "../assets/homescreen.png"
const Home = () => {
    return (
        <div>
            <div>
                <h1>Note</h1>
            </div>
            <h1>Note</h1>
            <img src={HomeImg} alt="home"/> 
        </div>
    );
};

export default Home;
